import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { login } from './api';
const Header = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();
  const [error, setError] = useState(null);

 const handleLogin = async (e) => {
  e.preventDefault();
    try {
      const response = await login(username, password); // Передаем username и password
	    console.log(response.status); 
      if (response.status == 200) { // Проверяем, успешна ли авторизация
        navigate('/profile');
      } else {
        setError(response.data.message); 
      }
    } catch (error) {
        setError('Ошибка авторизации.');
    }
  };

  
  return (
    <header>
    <div className='heading'>Здоровье в корзине</div>
    <h1 className='heading'>Авторизация</h1>
    <div className='container'>
      <div className='login'>
        <div className='form'>
          <form>
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              placeholder="Имя пользователя"
            />
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Пароль"
            />
            <button onClick={handleLogin}>
              Войти
            </button>
          </form>
        </div>
      </div>
    </div>
    <div class="navbar">
      <div class="thq-navbar-nav">
        <span>Журавская Е.В.<br></br>Теплякова Ю.Д.</span>
      </div>
    </div>
  </header>
  );
}

export default Header;
